Text:
@20-40

I said that the quality of your dvdrips don't "SUFFICE FOR ME"(=aren't good enough for me). I never implied that your encodes suck or that they are worse than someone else's. I just prefer 480p/720p brrips (~1.4gb/3gb), that's solely my opinion. There's no need to get all cranky about it. I said thanks and I meant it.

I seeded to a 2:1 ratio, I think that's more than fair with all the leechers on tpb.
